import React, { useEffect, useState } from 'react'

const Home = () => {
    const [content, setContent] = useState([])

    useEffect(() => {
        fetch('/storage_units')
            .then(r => r.json())
        .then(data => setContent(data))
    },[])
  return (
      <div>{
          content.map(cont => (
              <div key={cont.id}>
                  <img src={cont.image_url} alt='container' />

              </div>
          ))
       }</div>
  )
}

export default Home
